import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import { React, useState, Fragment } from 'react';
import axios from 'axios';
import NedBetalingsPlansListe from './nedbetalinsplanListe';
import { FormControl } from '@material-ui/core';



function Form() {

    const [open, setOpen] = useState(false);
    const [bAmount, setBAmount] = useState(50000);
    const [rate, setRate] = useState(0);
    const [expDate, setExprDate] = useState("2021-05-05");
    const [balanceDate, setBalanceDate] = useState("2020-11-11");
    const [dateFirstPay, setDateFirstPay] = useState("2020-11-11");
    const [list, setList] = useState([])


    function handleClickOpen() {
        setOpen(true)
    }

    function handleClose() {
        setOpen(false)
    }


    //handle submit of POST request
    function handleSubmit() {
        const options = {
            method: 'POST',
            url: 'https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan',
            headers: { 'Content-type': 'application/json' },
            data: {
                laanebelop: bAmount,
                nominellRente: rate,
                terminGebyr: 30,
                utlopsDato: expDate,
                saldoDato: balanceDate,
                datoForsteInnbetaling: dateFirstPay,
                ukjentVerdi: "TERMINBELOP"

            }
        }

        //send the post request and log the response data
        axios(options).then((response) => {
            setList(list.concat([response.data.nedbetalingsplan.innbetalinger]))
        }).catch(function (error) {
            console.log(error)
        });

        /**
         * []
         * [plan1]
         * [plan1] + [nyPlan] = [plan1, nyPlan]
         * [plan1, nyPlan] + [nyPlan2] = [plan1, nyPlan, nyPlan2]
         * ....
         */

        handleClose()
    }

    return (
        //Modal window by using material ui bootstrap
        //returning a fragment because it takes care of multiple component.
        //Chose the Dialog because it has the necessary property i need
        <Fragment>
            <Button onClick={handleClickOpen} color="primary">
                Legg til nedbetalingsplan
             </Button>
            <Dialog open={open} >
                <DialogTitle >Legg til ny plan</DialogTitle>
                <DialogContent>
                    <DialogContentText>
                        Vennligs fyll ut skjemaet nedenfor
          </DialogContentText>
                    {/*                    <TextField
                        label="Tittel"
                        value={tableTitle}
                        onChange={e => setTableTitle(e.target.value)}
                    />
                    <br /> */}
                    <TextField
                        required
                        label="Lånebeløp"
                        value={bAmount}
                        onChange={e => setBAmount(e.target.value)}
                    />
                    <br />
                    <TextField
                        label="Rente"
                        value={rate}
                        onChange={e => setRate(e.target.value)}
                    />
                    <br />
                    <TextField
                        label="Utløpsdato"
                        value={expDate}
                        onChange={e => setExprDate(e.target.value)}
                    />
                    <br />
                    <TextField
                        label="SaldoDato"
                        value={balanceDate}
                        onChange={e => setBalanceDate(e.target.value)}
                    />
                    <br />
                    <TextField
                        label="Dato første innbetaling"
                        value={dateFirstPay}
                        onChange={e => setDateFirstPay(e.target.value)}
                    />
                    <br />
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleSubmit} color="primary">
                        Legg til ny plan
                    </Button>
                </DialogActions>
            </Dialog>
            <NedBetalingsPlansListe list={list} />
        </Fragment>



    )
}
export default Form;
